import React from 'react';
var name;
var number;
var expMonth;
var expYear;
var cvc;

const SetCardInfo = (passedName, passedNumber, passedExpMonth, passedExpYear, passedCVC) => {
    name = passedName;
    number = passedNumber;
    expMonth = passedExpMonth;
    expYear = passedExpYear;
    cvc = passedCVC;
}

export default {
    SetCardInfo
};
